import React from 'react';
import './App.css';

function App(props) {
  return (
    <div>
      <div className="header">
        <h1>Tour Places</h1>
      </div>
      <div className="places-container">
        {props.prod.map((place, index) => (
          <div className="place" key={index}>
            <h2>{place.name}</h2>
            <img src={place.image} style={{ width: '300px', height: '250px', borderRadius: '12px' }} alt={place.name} />
            <br />
            <br />
            <a href="#">Book Now</a>
          </div>
        ))}
      </div>
      <div className="footer">
        <a href="#">Copyright</a>
      </div>
    </div>
  );
}

export default App;
